(94, 'Tigran Ayrapetyan', 'ujn2esbgakah@opayq.com', '86595255933', 'Hello, \r\n \r\nWe provide funding through our venture capital company to both start-up and existing companies either looking for funding for expansion or to accelerate growth in their company. \r\nWe have a structured joint venture investment plan in which we are interested in an annual return on investment not more than 10% ROI. We are also currently structuring a convertible debt and loan financing of 3% interest repayable annually with no early repayment penalties. \r\n \r\nWe would like to review your business plan or executive summary to understand a much better idea of your business and what you are looking to do, this will assist in determining the best possible investment structure we can pursue and discuss more extensively. \r\n \r\n \r\nI hope to hear back from you soon. \r\n \r\nSincerely, \r\n \r\nTigran Ayrapetyan \r\nInvestment Director \r\nDevcorp International W.L.L. \r\nP.O Box 10236 Shop No. 305 \r\nFlr 3 Manama Centre, Bahrain \r\nEmail: tigran.a@devcorpinternational.com', '2023-11-20 23:04:22', '2023-11-20 23:04:22'),
(95, 'BuddyFaith', 'k.a.tek.as.19.99@gmail.com', '82386152545', 'немалый объем автолюбителей сейчас не переживают о своей \"обуви\" для автомобилей до тех пор, пока не встретятся с неприятностями. \r\n \r\nв случае, если протектор оказывается излишне тонким, то резина приходит в неустойчивое состояние . Примите к сведению! Одной из существенных обновок, которые делают участники движения, всё-таки является резина. \r\n \r\nСогласно пожеланиям наших знатоков, постоянная установка шин вашего средства передвижения важна для стойкости на магистрали . \r\n[url=https://www.ssmexpert.md/forum/13-203-1]https://www.ssmexpert.md/forum/13-203-1[/url] \r\n \r\n \r\nзаказ новых покрышек может оказаться каверзной задачей. Вы сталкиваетесь с огромным ассортиментом брендов, размеров и моделей скатов , так что быстро можно запутаться. \r\n \r\nС намерением получить наслаждение от вождения, заказывайте колеса, которые подходят вашему стилю вождения. \r\n \r\nПоявились сомнения в замене подходящих колес для вашей машины? наш персонал профессиональных экспертов поможет вам своими знаниями. \r\n \r\nВам нравится бесшумная поездка? Или вы отдаете предпочтение чувствовать каждый поворот? Замечательно! наши опытные ребята с легкостью предложат вам идеальные скаты! \r\n \r\nморе факторов вредят вашим шинам. Начиная от выбоин и заканчивая превышением скорости. \r\n \r\nв том случае, когда вы приобритете неправильные скаты, то вы можете понизить производительность вашей машины и его способность справляться с любыми погодными условиями. Шины вашего транспорта усердно работают всегда, когда вы выезжаете на магистраль. \r\n \r\nлучший метод разобраться, настал ли момент устанавливать новые шины для вашего авто, — это поручить их обследование опытныму человеку. \r\n \r\nв нашем автомаркете вы сможете отыскать скаты всяческих марок и брендов! И все по минимальным ценам! Поможем купить идеальные для вас! \r\n \r\nнаш автоцентр ставит на первое место просьбы клиента. соответственно множество хозяинов авто доверяет нам! Мы гарантируем качество! забегайте! И убедитесь сами!', '2023-11-21 00:42:25', '2023-11-21 00:42:25'),
(96, 'Deniel', 'deniel@hotmail.com', '800421364384', 'https://go.hesoties.com/0lxh \r\n \r\nAnd You Can Become The Next Millionaire.', '2023-11-22 00:50:19', '2023-11-22 00:50:19'),
(97, 'Jimmievathy', 'ma.ximk.a.z9.91.2@gmail.com', '88613235527', 'немалое число владельцев авто сейчас не беспокоятся о своих колесах до тех пор, пока не угодят в опасную ситуацию. \r\n \r\nв случае, если протектор становится чрезвычайно тонким, то покрышки приходят в ненадежное состояние. Держите в памяти! Одной из необходимых обновок, которые делают автовладельцы, непосредственно являются шины. \r\n \r\nСогласно напутствиям наших экспертов, регулярная установка шин вашего автомобиля важна для надежности на асфальте. \r\n[url=http://forum.doctorulmeu.md/viewtopic.php?t=89509]http://forum.doctorulmeu.md/viewtopic.php?t=89509[/url] \r\n \r\n \r\nустановка новых колес может оказаться каверзной проблемой. Вы сталкиваетесь с немаленьким выбором брендов, размеров и моделей скатов , соответственно без проблем можно сбиться с мысли. \r\n \r\nС намерением получить восторг от поездки, приобретайте скаты, которые подходят вашему стилю управления. \r\n \r\nвам нужна помощь в замене подходящей резины для вашего транспортного средства? наш штат сотрудников опытных мастеров поможет вам своим энтузиазмом. \r\n \r\nВам нравится удобная поездка? Или вы избираете чувствовать каждый поворот? Так и запишем! наши профессионалы моментально поищат вам идеальные скаты! \r\n \r\nтысячи факторов вредят вашим колесам. Начиная от препятствий и заканчивая льдом. \r\n \r\nв том случае, когда вы приобритете неправильные колеса, то вы можете понизить эффективность вашей легковушки и его потенциал справляться с любым временем года. Скаты вашего авто тщательно работают каждый раз, когда вы выезжаете на твердую поверхность. \r\n \r\nлучший метод понять, настал ли момент покупать новые шины для вашего авто, — это возложить их осмотр опытныму человеку. \r\n \r\nв нашем магазине вы сможете выбрать колеса именитых марок и брендов! И все по интересным ценам! Поможем купить подходящие вам! \r\n \r\nнаша мастерская по ремонту автомобилей ставит на первое место приоритеты клиента. учитывая этот факт огромное число владельцев авто верят нам! Мы гарантируем качество! приходите! И убедитесь сами!', '2023-11-22 06:23:14', '2023-11-22 06:23:14');
