(101, 'Williamlok', 'mai.lfo.rpo.in.t.9.4@gmail.com', '87413233196', 'Автосервис для Машинки: В случае если ваша машинка начала странности творить, не беспокойтесь, у нас есть волшебники, которые отремонтируют ее. Масло, тормоза, движок — они там в этом шарят! \r\n \r\nВозводим Сайты: Хотите собственный личный галлактический сайт? У нас есть ребята, коие могут это устроить. Прекрасно, ясно, несложно. Даже в случае если вы в интернете чайник — не жутко, они объяснят. \r\n \r\nПоддержка с Компьютером: Если у вас компьютер тупит, как я в математике, не переживайте! Мы вас спасем. Вирусы, глюки, чудеса — наши специалисты разберутся. \r\n \r\nБизнес-Советы: Мечтаете о собственном бизнесе, но не знаете, с чего начать? Мы не бизнесмены, но у нас здесь есть ценители, коие дадут совет, как не \"попасть в грабли\". \r\n \r\nШопинг интернет: Интернет-магазин тем, кто любит нажимать кнопочки и получать посылочки. Здесь багаж от наших приятелей, испытано — качество замечательное! \r\n[url=https://www.efesmoldova.md/]https://www.efesmoldova.md/[/url] \r\n \r\nПоддержка и Общение: У нас как в немалый семье, только интернет. Мы готовы посодействовать, поддержать, поболтать. Иногда просто важно, чтобы был кто-то вблизи. \r\n \r\nИнновации и Крутые Штуки: Ну и конечно, мы смотрим за последними трендами и подкидываем для вас заманчивых штукенций. Девайсы, новинки — мы в курсе и готовы поделиться. \r\n \r\nПонятно и Честно: Тут никто не будет вас заваливать сложными текстами или техническим жаргоном. Все очень просто и понятно, как ребятам. \r\n \r\nДоверие и Дружба: Мы не просто вебсайт, мы приятели. Практически постоянно счастливы вашим вопросам и предложениям. Мы доверяем для вас, и вам продоставляется возможность доверять нам. \r\n \r\nИтоги и Спасибо: Вот такие у нас приключения. Мы тут, чтобы посодействовать вам, не зависимо от того, насколько вы в чем либо разбираетесь. Имущество пожаловать в нашу интернет-семью!', '2023-11-28 19:38:36', '2023-11-28 19:38:36'),
(102, 'Pitroda Satyan', 'projectdept@kanzalshamsprojectmgt.com', '82225322254', 'Greetings, \r\n \r\nAm glad to connect with you, My name is Pitroda Satyan G, am an investment consultant with KANZ ALSHAMS PROJECT CONSULTANT, I have been mandated by the company to source for investment opportunities and companies seeking for funding, business loans, for its project(s). Do you have any investment or project that is seeking for capital to fund it? \r\n \r\nOur Investments financing focus is on: \r\n \r\nSeed Capital, Early-Stage, Start-Up Ventures, , Brokerage, Private Finance, Renewable Energy Project, Commercial Real Estate, Blockchain, Technology, Telecommunication, Infrastructure, Agriculture, Animal Breeding, Hospitality, Healthcare, Oil/Gas/Refinery. Application reserved for business executives and companies with proven business records in search of funding for expansion or forcapital investments.. \r\n \r\nKindly contact me for further details. \r\n \r\nawait your return e.mail soonest. \r\n \r\nRegards \r\n \r\nDr. Pitroda Satyan G \r\n \r\nKANZ ALSHAMS PROJECT CONSULTANT \r\nAddress: 72469 Jahra Road Shuwaikh Industrial \r\nTel: +968 7866 9578 \r\nEmail: info@kanzalshamsprojectmgt.com', '2023-11-29 15:06:50', '2023-11-29 15:06:50'),
