(1, 'Canada', 'Considering studying in the Canada from Bangladesh and in need of assistance choosing a suitable program and university? NHP is here to support you! Utilize our services to process your application via expert consultants trained by the British Council and British Graduate.', '<p>One of the main advantages of studying in Canada is that you will be exposed to different cultures and experiences. The sights, sounds, and tastes of Canada are varied. Whether you enjoy exploring cities or prefer to get out into the countryside, Canada has something to offer you.</p>\r\n\r\n<p><strong>Global Leader in International Education</strong></p>\r\n\r\n<p>According to the QS World University Rankings (2012), four of the top six universities in the world are in Canada. By studying in Canada, you have the opportunity to graduate from one of the best education systems in the world!</p>\r\n\r\n<p><strong>Excellent International Reputation</strong></p>\r\n\r\n<p>Canadian qualifications are recognized internationally and valued by employers, universities, and governments throughout the world. Canada is a popular destination for international students, and well respected for world-class standards of teaching. Canada is also renowned for the excellence of its research and teaching.</p>\r\n\r\n<p><strong>Value for Money</strong></p>\r\n\r\n<p>Canadian undergraduate study offers fantastic value for money and the sort of experience you can&rsquo;t put a price on. Undergraduate and postgraduate courses in Canada are generally much shorter than those abroad, which helps to reduce the amount of money required in paying tuition fees and living costs. Most undergraduate courses take four years to complete. A postgraduate Masters course will normally only take 1 to 2 years, whereas a PhD will take 3 to 4 years. Furthermore, as an international student, you can work as well as study. If you are studying at degree level or above, you are permitted to work up to 20 hours a week during term time, with no limit during vacation periods. This can help you to gain both extra finances to support your studies and valuable work experience. You will also have access to healthcare services.</p>\r\n\r\n<p><strong>Improve your English</strong></p>\r\n\r\n<p>By studying and living in Canada, you will be immersed in the language and have the opportunity to perfect your English communication skills. Practice your English language skills every day, in shops and caf&eacute;s and while you&rsquo;re out with English-speaking friends, as well as in seminars and discussion groups on your course.</p>\r\n\r\n<p><strong>Multicultural Experience</strong></p>\r\n\r\n<p>Canada is a multicultural, multi-faith country that has always welcomed migrants and visitors from abroad. By living in Canada, you will have the opportunity to experience new culture and meet people from different cultures and countries. And, because Canada is such a popular destination for international students, you are sure to meet people from all over the world during your time in Canada.</p>', '<p>One of the main advantages of studying in Canada is that you will be exposed to different cultures and experiences. The sights, sounds, and tastes of Canada are varied. Whether you enjoy exploring cities or prefer to get out into the countryside, Canada has something to offer you.</p>\r\n\r\n<p><strong>Global Leader in International Education</strong></p>\r\n\r\n<p>According to the QS World University Rankings (2012), four of the top six universities in the world are in Canada. By studying in Canada, you have the opportunity to graduate from one of the best education systems in the world!</p>\r\n\r\n<p><strong>Excellent International Reputation</strong></p>\r\n\r\n<p>Canadian qualifications are recognised internationally and valued by employers, universities, and governments throughout the world. Canada is a popular destination for international students, and well respected for worldclass standards of teachin