n those abroad, which helps to reduce the amount of money required in paying tuition fees and living costs. Most undergraduate courses take four years to complete, although in some cases, it might be a bit longer. A postgraduate Masters course will normally only take 1 to 2 years, whereas a PhD will take 3 to 4 years. Furthermore, as an international student, you can work as well as study. If you are studying at degree level or above, you are permitted to work up to 20 hours a week during term time, with no limit during vacation periods. This can help you to gain both extra finances to support your studies and valuable work experience. You will also have access to healthcare services.</p>\r\n\r\n<p><strong>Improve your English</strong></p>\r\n\r\n<p>By studying and living in Canada, you will be immersed in the language and have the opportunity to perfect your English communication skills. Practice your English language skills every day, in shops and caf&eacute;s and while you&rsquo;re out with English-speaking friends, as well as in seminars and discussion groups on your course.</p>\r\n\r\n<p><strong>Multicultural Experience</strong></p>\r\n\r\n<p>Canada is a multicultural, multi-faith country that has always welcomed migrants and visitors from abroad. By living in Canada, you will have the opportunity to experience new cultures and meet people from different cultures and countries. And, because Canada is such a popular destination for international students, you are sure to meet people from all over the world during your time in Canada.</p>', 'uploads/destinations/1695820806-Study-in-Canada.jpg', 1, '2023-09-27 13:20:06', '2023-09-27 13:20:06'),
(3, 'USA', 'BSM is the market leader and highly respected for its services in placing students in reputed universities in the USA.', '<p>Studying in the United States and abroad doesn&#39;t just earn you tangible degrees and certificates; it opens up a world of opportunities. For any international student, the USA has a lot to offer: boasting one of the most prestigious and top-ranked higher education systems globally, diverse cities, picturesque natural parks, rich culture, history, and a highly multicultural population.</p>\r\n\r\n<p><strong>Academic Excellence</strong></p>\r\n\r\n<p>The United States boasts one of the world&#39;s most esteemed university systems, attracting over 30% (500,000) of all international students worldwide each year. According to the QS World University Rankings, 13 of the top 20 universities globally are situated in the USA.</p>\r\n\r\n<p><strong>Quality Education</strong></p>\r\n\r\n<p>The USA hosts more higher learning institutions than any other country globally, providing unequivocally high-quality education. The research conducted in these institutions is at the forefront of their respective fields and is frequently published in prestigious journals worldwide. The USA has historically been a hub of innovation, with universities playing a pivotal role in driving this progress.</p>\r\n\r\n<p><strong>Diversity and Variety</strong></p>\r\n\r\n<p>The United States offers an abundance of variety, providing a wide range of schools, numerous areas of study, and specialized degrees. If you&#39;re inclined towards studying business, you&#39;re not limited to a generic curriculum; there&#39;s a plethora of concentrations to choose from such as accounting, marketing, international business, business management, business administration, or finance, available at undergraduate, graduate, and doctoral levels, among others.</p>\r\n\r\n<p><strong>Good Career Prospects</strong></p>\r\n\r\n<p>Upon completing your degree, you are legally permitted to work in the US in your relevant field for about a year through Optional Practical Training Employment Authorization (OPT). Many international students find opportunities with the company they were affiliated with during their OPT period, often securing sponsorship for an H1-B or work visa. The H1-B work visa is typically granted by employers, especially in specialized areas like software, engineering, accountancy, teaching, or marketing, allowing you to work in the US without returning to your home country.</p>\r\n\r\n<p><strong>Enhance Your English Skills</strong></p>\r\n\r\n<p>Enhancing or honing your English skills is a primary motivator for many students studying abroad. Being immersed in an English-speaking environment and using the language daily provides an excellent and effortless way to enhance your language proficiency. English is the global language of business, and mastering it is paramount for a successful career.</p>\r\n\r\n<p>BSM provides guidance and support for international students seeking enriching educational experiences in the United States, helping you navigate this transformative journey.</p>', '<p><strong>University Application Documents:</strong></p>\r\n\r\n<ol>\r\n	<li>Application Fee (non-refundable) - typically between $40 to $150</li>\r\n	<li>Passport Scan Copy</li>\r\n	<li>Scan Copies or Official Sealed Copies of Bachelor/Masters Certificates &amp; Transcripts</li>\r\n	<li>Scan Copies or Certified/Notarized Copies of SSC/O Level and HSC/A Level Certificates and Marksheets</li>\r\n	<li>Two/Three Academic Reference Letters (Scan Copies or Certified Copies)</li>\r\n	<li>Statement of Purpose</li>\r\n	<li>IELTS/TOEFL Certificate (Scan copy or Notarized copy)</li>\r\n	<li>SAT/GMAT/GRE Score (if required, scan copy)</li>\r\n	<li>Job Experience Letter (if required)</li>\r\n	<li>Statement of Financial Support Form (non-US sponsor) or I-134 Form (US sponsor)</li>\r\n	<li>Bank Solvency Certificate from Sponsor</li>\r\n	<li>Resume or CV (if required)</li>\r\n	<li>Other Supporting Documents, if available (e.g., extracurricular activities)</li>\r\n</ol>\r\n\r\n<p><strong>F1 Student Visa Application Documents:</strong></p>\r\n\r\n<ol>\r\n	<li>Valid Passport</li>\r\n	<li>DS-160 Confirmation Pages (legible barcodes)</li>\r\n	<li>One photograph for each application (2&rdquo; * 2&rdquo; or 600px * 600px)</li>\r\n	<li>Visa Application Fee (F1 Student Visa Application Fee - $160)</li>\r\n	<li>SEVIS Fee Receipt</li>\r\n	<li>Original I-20</li>\r\n	<li>Original Educational Certificates, Marksheets, and Transcripts</li>\r\n	<li>TOEFL/IELTS Certificate</li>\r\n	<li>GRE/GMAT/SAT/ACT Certificate (if required)</li>\r\n	<li>Job Experience Letter (if applicable)</li>\r\n	<li>Three to twelve months of bank statements for student visa applicants (NEC recommends submitting a minimum of 6 months&#39; bank statements)</li>\r\n	<li>Bank Solvency Certificate</li>\r\n	<li>Affidavit of Financial Support</li>\r\n	<li>Source of Income documents (e.g., Trade License, Tin Certificate, etc.)</li>\r\n	<li>Any Other Supporting Documents</li>\r\n</ol>\r\n\r\n<p>Please ensure all documents are presented in the required format and meet the guidelines specified by the university and the U.S. immigration authorities for a smooth application process.</p>', '<p>In the United States, universities typically offer three main intakes:</p>\r\n\r\n<ul>\r\n	<li>Spring: January/February</li>\r\n	<li>Fall: August/September</li>\r\n	<li>Summer: May/June</li>\r\n</ul>\r\n\r\n<p>The primary intakes are Fall and Spring, although some universities also have a Summer Intake.</p>\r\n\r\n<p>English Language Proficiency Requirements: Every student must meet the specified English language proficiency requirements for their chosen course. Depending on the university, undergraduate programs usually require an IELTS score of 5.5 to 6.5, and postgraduate programs require a score of 6.0 to 6.5. Alternatively, a TOEFL score of 79 to 100 is also acceptable.</p>\r\n\r\n<p>Academic Criteria: For Bachelor&#39;s degrees (undergraduate), which typically have a duration of 4 years, the minimum qualifications for Bangladeshi students are as follows:</p>\r\n\r\n<ul>\r\n	<li>SSC or equivalent exam GPA of 3.5+</li>\r\n	<li>HSC or equivalent exam GPA of 3.5+</li>\r\n	<li>Mandatory IELTS or TOEFL</li>\r\n	<li>SAT/ACT for Top Ranked Universities</li>\r\n</ul>\r\n\r\n<p>For Master&#39;s degrees (graduate/postgraduate), the duration varies but generally ranges from one to two years depending on the university and specialization. Most Master&#39;s programs in the USA span two years, although students can often accelerate completion in a little over 18 months by maximizing their credit load. The minimum qualifications for Bangladeshi students pursuing a Master&#39;s are as follows:</p>\r\n\r\n<ul>\r\n	<li>Graduation or equivalent exam CGPA of 2.75+</li>\r\n	<li>Mandatory IELTS or TOEFL</li>\r\n	<li>GMAT or GRE for Business, Science, and Engineering programs</li>\r\n	<li>Some institutions may waive GMAT or GRE requirements</li>\r\n</ul>\r\n\r\n<p>At BSM, we guide and support Bangladeshi students in navigating these criteria and help them pursue enriching educational experiences in the United States.</p>', '<p>In the United States, universities typically offer three main intakes:</p>\r\n\r\n<ul>\r\n	<li>Spring: January/February</li>\r\n	<li>Fall: August/September</li>\r\n	<li>Summer: May/June</li>\r\n</ul>\r\n\r\n<p>The primary intakes are Fall and Spring, although some universities also have a Summer Intake.</p>\r\n\r\n<p>English Language Proficiency Requirements: Every student must meet the specified English language proficiency requirements for their chosen course. Depending on the university, undergraduate programs usually require an IELTS score of 5.5 to 6.5, and postgraduate programs require a score of 6.0 to 6.5. Alternatively, a TOEFL score of 79 to 100 is also acceptable.</p>\r\n\r\n<p>Academic Criteria: For Bachelor&#39;s degrees (undergraduate), which typically have a duration of 4 years, the minimum qualifications for Bangladeshi students are as follows:</p>\r\n\r\n<ul>\r\n	<li>SSC or equivalent exam GPA of 3.5+</li>\r\n	<li>HSC or equivalent exam GPA of 3.5+</li>\r\n	<li>Mandatory IELTS or TOEFL</li>\r\n	<li>SAT/ACT for Top Ranked Universities</li>\r\n</ul>\r\n\r\n<p>For Master&#39;s degrees (graduate/postgraduate), the duration varies but generally ranges from one to two years depending on the university and specialization. Most Master&#39;s programs in the USA span two years, although students can often accelerate completion in a little over 18 months by maximizing their credit load. The minimum qualifications for Bangladeshi students pursuing a Master&#39;s are as follows:</p>\r\n\r\n<ul>\r\n	<li>Graduation or equivalent exam CGPA of 2.75+</li>\r\n	<li>Mandatory IELTS or TOEFL</li>\r\n	<li>GMAT or GRE for Business, Science, and Engineering programs</li>\r\n	<li>Some institutions may waive GMAT or GRE requirements</li>\r\n</ul>\r\n\r\n<p>At BSM, we guide and support Bangladeshi students in navigating these criteria and help them pursue enriching educational experiences in the United States.</p>', 'uploads/destinations/1695664671-study-abroad-usa.jpg', 1, '2023-10-03 19:08:48', '2023-10-03 19:08:48'),
(4, 'Australia', 'BSM Edumini Consultants is a leading education consultancy firm serving students to attain their career aspirations of studying in Australia.', '<p>Australia has consistently been a top choice for students seeking education abroad. Its multicultural society fosters a safe, welcoming, and sophisticated environment that encourages learning and exploration. Remarkably, despite its population of only 23 million, Australia ranks third globally in hosting international students, trailing behind only the United Kingdom and the United States.</p>\r\n\r\n<p><strong>Academic Excellence:</strong></p>\r\n\r\n<p>Australia delivers an educational experience that truly stands out. The pedagogical approach encourages innovation, creativity, and independent thinking. The country is globally acclaimed for its vocational and technical education, considered among the world&#39;s finest and most progressive. Australian universities are renowned for their excellence across various academic disciplines.</p>\r\n\r\n<p><strong>Global Recognition:</strong> Australian qualifications and institutions are highly regarded worldwide for their exceptional quality. Graduates from Australian institutions enjoy remarkable success in securing jobs and holding influential positions globally. Moreover, most courses and training pursued by international students in Australia align with the Australian Qualifications Framework (AQF), a government-endorsed system of learning.</p>\r\n\r\n<p><strong>Research and Technology:</strong></p>\r\n\r\n<p>Australia ranks among the top 10 countries in research and development spending (0.71% of GDP). The nation publishes an impressive quantity of scientific papers&mdash;approximately 250,000 in a decade&mdash;positioning itself at the forefront of technological advancements and innovations.</p>\r\n\r\n<p><strong>Value for Money:</strong></p>\r\n\r\n<p>Australia offers outstanding value for money, with living expenses and tuition costs significantly lower than those in the United States of America (USA). Additionally, international students in Australia have the opportunity to work part-time (up to 20 hours a week), and during holidays, they can work full time. This is a valuable prospect for students looking to support their living expenses or gain work experience in their field of interest while studying.</p>\r\n\r\n<p><strong>Opportunities to Work after Graduation:</strong></p>\r\n\r\n<p>It&#39;s natural for students to desire to work in the country where they&#39;ve invested time and resources in education before embarking on further pursuits. Recent changes in government policies have made it more feasible for international students to work in Australia after completing their education (subject to specific conditions). This provision allows students to augment their resumes not only with international education but also with international work experience.</p>', '<p>&quot;The documents required for your visa application depend on your personal situation, the course you intend to study, and the nature of employment of your sponsor. In general, you will need the following documents for your application to BSM Edumini:</p>\r\n\r\n<ol>\r\n	<li>Proof of enrollment (your Electronic Confirmation of Enrolment)</li>\r\n	<li>Health insurance (Overseas Student Health Cover) policy details</li>\r\n	<li>Genuine Temporary Entrant (GTE) statement</li>\r\n	<li>Evidence of your English language proficiency</li>\r\n	<li>Statement of purpose</li>\r\n	<li>Evidence of financial capability (tuition fees, living expenses, expenses for dependents, return airfare)</li>\r\n	<li>A valid passport</li>\r\n	<li>Visa application fee</li>\r\n	<li>Academic and work experience documents</li>\r\n</ol>\r\n\r\n<p>If you are under 18 years of age, additional documents such as parental consent will also be required.&quot;</p>', '<p>Australia typically has two major intakes for students, which are in February and July. Some universities also offer additional intakes in September and November. It is advisable to initiate the application process about 7-8 months before the intended intake. Universities usually take approximately 4-6 weeks to process applications.</p>\r\n\r\n<p><strong>English Language Requirements:</strong> The English language requirements can vary among institutions. Generally, undergraduate courses require an IELTS score of 6.0, while postgraduate courses often require a score of 6.5.</p>\r\n\r\n<p><strong>Academic Requirements:</strong> <em>Undergraduate (Bachelors):</em></p>\r\n\r\n<ul>\r\n	<li>A strong academic record in the High School Certificate or equivalent (12 years of schooling).</li>\r\n	<li>Certain courses like Computing and Engineering may require Mathematics and/or Science as prerequisites.</li>\r\n</ul>\r\n\r\n<p><em>Postgraduate (Masters):</em></p>\r\n\r\n<ul>\r\n	<li>A strong academic record in a Bachelors Degree from a recognized university.</li>\r\n	<li>Relevant work experience in the field can be advantageous.</li>\r\n	<li>Some MBA programs at certain universities may necessitate work experience in addition to a Bachelors Degree.</li>\r\n</ul>', '<p>The type of visa required depends on the specific program or course you intend to pursue and the duration of your stay in Australia. Comprehensive information about each visa type can be found on the Australian Government&rsquo;s Department of Immigration and Border Protection (DIBP) website.</p>\r\n\r\n<p><strong>Online Application:</strong> To initiate your student visa application, it is mandatory to set up an account using the DIBP&rsquo;s online application system called ImmiAccount. This platform facilitates the completion and submission of your student visa application. Additionally, ImmiAccount allows you to track the progress of your visa application after submission.</p>\r\n\r\n<p>It is advisable to submit your visa application no later than six weeks before the commencement of your course, but not earlier than 12 weeks.</p>\r\n\r\n<p>Upon submission, the Australian Government will assign a unique Transaction Reference Number (TRN) to your application. The status of your application can be monitored online at <a href=\"http://www.homeaffairs.gov.au/\" target=\"_new\">http://www.homeaffairs.gov.au/</a>.</p>', 'uploads/destinations/1695665664-WhatsApp-Image-2022-03-22-at-6.23.04-PM-1200x700.jpeg', 1, '2023-09-25 18:14:24', '2023-09-25 18:14:24');
