INSERT INTO `website_data` (`id`, `val`, `created_at`, `updated_at`) VALUES
(1, '<b>Employment-Based or EB3 :</b> Third Preference, is a visa category within the U.S. immigration system. It s designed for skilled workers, professionals, and other workers. The EB-3 visa allows individuals to work and live permanently in the U.S. To qualify, applicants need a job offer from a U.S. employer, meet the education or work experience requirements, and have a labor certification approved by the U.S. Department of Labor', '2023-09-23 03:41:24', '2023-09-22 21:41:24'),
(2, '1. What is the EB-3 visa?', '2023-09-25 17:46:33', '2023-09-25 17:46:33'),
(3, 'A U.S. employment-based visa for skilled workers, professionals, and other workers, allowing permanent residency based on job offers and qualifications.', '2023-09-22 15:36:14', NULL),
(4, '2. How long does the entire EB-3 visa process take?', '2023-10-11 13:43:51', '2023-10-11 13:43:51'),
(5, 'Approximately 2-3 years.', '2023-10-11 13:44:21', '2023-10-11 13:44:21'),
(6, '3. Is there a cap on EB-3 visas?', '2023-09-22 15:36:14', NULL),
(7, 'Yes, there are annual numerical limits on EB-3 visas, which can impact processing times and availability.', '2023-09-22 15:36:14', NULL),
(8, '4. Can family members accompany EB-3 visa holders?', '2023-09-22 15:36:14', NULL),
(9, 'Yes, immediate family members (spouse and unmarried children under 21) can typically accompany or follow to join the EB-3 visa holder in the U.S.', '2023-09-22 18:31:11', '2023-09-22 12:31:11'),
(10, 'Explore New Horizons: Request a Complimentary Consultation from BSM Education and embark on a personalized journey towards your educational aspirations. Let\'s shape your future together. Reach out for guidance and support today.', '2023-09-22 15:52:06', NULL),
