(35, 'The <a href=\"https://www.uscis.gov/working-in-the-united-states/permanent-workers/employment-based-immigration-third-preference-eb-3\">EB-3 Visa Green Card</a>  program allows employers to fill these unskilled and low skilled jobs with foreign national workers. <br>\r\n<b>How Does the EB-3 Visa Program Work?</b>  <br>\r\n<u>Step 1: Permanent Labor Certification</u> </br>\r\nA <a href=\"https://www.dol.gov/agencies/eta/foreign-labor/programs/permanent\">permanent labor certification</a>  issued by the Department of Labor (DOL) allows an employer to hire a foreign worker to work permanently in the United States. <br>\r\nBefore the U.S. employer can submit an immigration petition (USCIS Form I-140) to the Department of Homeland Security’s U.S. Citizenship and Immigration Services (USCIS), the employer must obtain a certified labor certification application from the DOL’s Employment and Training Administration (ETA).The DOL must certify to the USCIS that there are not sufficient U.S. workers able, willing, qualified and available to accept the job opportunity in the area of intended employment and that...', '2023-10-11 15:40:11', '2023-10-11 15:40:11'),
(36, 'uploads/1695450251.jpg', '2023-09-23 06:24:11', '2023-09-23 00:24:11'),
(37, 'Introducing BSM Education, your trusted partner in navigating the complexities of EB-3 immigration pathways. The EB-3 visa, part of the Employment-Based Third Preference category, is a critical avenue for skilled workers, professionals, and other workers aspiring to establish a career in the United States. At BSM Education, we specialize in guiding individuals through the entire EB-3 process, ensuring a seamless journey towards securing employment-based visas. Our experienced consultants work closely with both employers and applicants, offering comprehensive assistance in labor certification, petition filing, and compliance with U.S. immigration regulations. We prioritize understanding your unique circumstances and tailor our services to your specific needs, optimizing the likelihood of a successful EB-3 visa application. Let BSM Education be your go-to immigration consultancy, committed to realizing your American dream through the EB-3 visa program.', '2023-09-23 06:18:08', NULL),
(38, 'uploads/tour-vsa.jpg', '2023-09-23 06:29:59', NULL),
(39, 'Welcome to BSM Education, your dedicated partner for seamless VISIT/TOURIST VISA services. Our mission is to ensure a hassle-free and smooth visa application process, providing expert guidance and support every step of the way.\r\n\r\nNavigating the visa application process can be intricate, often involving gathering numerous documents and accurately completing forms. That\'s where our experienced and dedicated team comes in. We assist you in collecting the necessary documents and ensure precise and timely completion of all required forms. We stay updated with the ever-changing immigration regulations to keep your application process as current as possible.\r\n\r\nAt BSM Education, we understand the importance of efficiency and peace of mind when it comes to planning your trip. Our team is committed to offering personalized assistance, tailoring our services to meet your specific needs. We streamline the application procedure, making sure all the requirements are met promptly and accurately.', '2023-10-03 19:45:12', '2023-10-03 19:45:12'),
(40, 'uploads/business-visa.jpg', '2023-09-23 06:33:07', NULL),
(41, 'When seeking a dedicated space for a Managing Partner, consider exploring local commercial real estate listings through platforms like LoopNet, CoStar Group, and Craigslist. Engage with specialized commercial real estate agents to find suitable options tailored to the needs of a Managing Partner. Business centers, co-working spaces, or executive suites often offer private offices suitable for a Managing Partner. These spaces provide necessary amenities such as high-speed internet, conference rooms, and administrative support, creating a conducive environment for focused work and client meetings. Networking within relevant industry circles and attending local business events can yield valuable leads on available Managing Partner office spaces. Additionally, reaching out to property management companies and visiting spaces in person will help in assessing if they meet the specific requirements in terms of location, facilities, size, and budget. Selecting an appropriate space is crucial to enhance the effectiveness and productivity of a Managing Partner.\r\n\r\n', '2023-09-23 06:29:59', NULL),
